import axios from 'axios';
import FriendVO from '../VO/friendVO';

export interface IFriendList {
    list : FriendVO[];
}


export const getFriendList = (id: string) : any => {   
    const url = './friendList.json'
    return axios.post<IFriendList>(url);
}
